import styled from "styled-components";
import { AreaChart, Area, Tooltip, ResponsiveContainer } from "recharts";
import { cardStyle } from '../components/ReusableStyles';
import { BiWallet } from 'react-icons/bi';
import { RadialBarChart, RadialBar} from "recharts";
import { BsThreeDots } from "react-icons/bs";
import {BiRotateLeft } from "react-icons/bi";
import React, { useState, useEffect } from 'react'
import axios from "axios";
const data = [
  {
    name: "18-24",
    uv: 21.47,
    pv: 2400,
    fill: "#fdc5f5",
  },
  {
    name: "25-29",
    uv: 26.69,
    pv: 4567,
    fill: "#f7aef8",
  },
  {
    name: "30-34",
    uv: 15.69,
    pv: 1398,
    fill: "#b388eb",
  },
  {
    name: "35-39",
    uv: 28.22,
    pv: 9800,
    fill: "#82ca9d",
  },
  {
    name: "40-49",
    uv: 18.63,
    pv: 3908,
    fill: "#8093f1",
  },
  {
    name: "50+",
    uv: 24.63,

    fill: "#72ddf7",
  },
];


export default function EarningAgent() {
  const reloadPage = () => {
    window.location.reload()
  }
 
    
  return (
    <Section>
    <div className="top">
      <div className="info">
        <h1>Agent  </h1>
        <h5>amount</h5>
        <BiWallet className='logo'/>
        <BiRotateLeft onClick={reloadPage} className='logo'/>
         
        <div className="growth">
        
          <span>nactive</span>
        </div>
        <h5>Your Account Number </h5>
        <h1>2342</h1>
        <ResponsiveContainer width="100%" height="80%">
        <RadialBarChart
          cx="50%"
          cy="50%"
          innerRadius="10%"
          outerRadius="70%"
          data={data}
        >
          <RadialBar minAngle={15} clockWise dataKey="uv" />
        </RadialBarChart>
      </ResponsiveContainer>
      </div>
   
    </div>
   
    <div className="chart">
    
    </div>
  </Section>
  )
}
const Section=styled.section`
display: flex;
width: 600px;
hight: 500px;
box-shadow: 0 5px 8px 0 rgba(0, 0, 0, 0.2), 0 7px 20px 0 rgba(0, 0, 0, 0.2);
  flex-direction: column;
  justify-content: space-between;
  min-height: 20rem;
  ${cardStyle}
  padding: 2rem 0 0 0;
  .top{
    .info{
      display: flex;
      flex-direction: column;
      align-items: center;
      box-shadow: 0 5px 8px 0 rgba(0, 0, 0, 0.2), 0 7px 20px 0 rgba(0, 0, 0, 0.2);
      gap: 0.3rem;
      h1{
        font-size: 2rem;
      }
       .logo{
        display: flex;
       
        background-color: black;
        border-radius: 3rem;
        font-size: 1.5rem;
      
       }
       .growth{
        background-color: #d7e41e1d;
        padding: 0.5rem;
        border-radius: 1rem;
        transition: 0.3s ease-in-out;
        &: hover{
          background-color: #ffc107;
          span{
            color: black;
          }

        }
        span{
          color: #ffc107;
        }
      }
       
    }
    
  }


.chart{
  height:70%;
  .recharts-default-tooltip{
    background-color:black !important;
    border-color:black !important;
  }
}
`;
